import React from "react";
import "./VideoList.scss";
// import VideoCard from "../video-card/VideoCard";

export default function VideoList({ changeVideo, video }) {
  return (
    <section className="video-list-section">
      {video.map((video) => {
        return (
          <article
            className="video-card"
            onClick={(event) => {
              changeVideo(video[0], event);
            }}
          >
            <div className="video-card__img-container">
              <img
                className="video-card__img-container--img"
                src={video.image}
                alt={video.title}
              ></img>
            </div>
            <div className="video-card__details">
              <p className="video-card__details--title">{video.title}</p>
              <p className="video-card__details--channel">{video.channel}</p>
            </div>
          </article>
        );
      })}
    </section>
  );
}

